import React from 'react';
import { Chart } from "react-google-charts";
import Loader from "../reusableComponents/Loader";
import { Progress } from 'reactstrap';
const JirasChart=(props)=>{
    return(
        <div>
            <Chart
                width={'450px'}
                height={'200px'}
                chartType="BarChart"
                loader={<Loader/>}
                data={[
                    ['Jiras','Count'],
                    ['SWIFT-5920', 4],
                    ['SWIFT-10632', 3],
                    ['SWIFT-8530', 2],
                    ['SWIFT-8559', 2],
                    ['SWIFT-10330', 1],
                ]}
                options={{
                    color:'red',
                    title: 'Jira count in presented cycles',
                    chartArea: { width: '50%' },
                    hAxis: {
                        title: 'Count',
                        minValue: 0,
                    },
                    vAxis: {
                        title: 'Jiras',
                    },
                }}
                // For tests
                rootProps={{ 'data-testid': '1' }}
            />
            <div className="text-center">Stripes and Animations</div>
            <Progress multi>
                <Progress bar striped value="15">Stripes</Progress>
                <Progress bar animated color="success" value="30">Animated Stripes</Progress>
                <Progress bar color="info" value="25">Plain</Progress>
            </Progress>
        
        </div>
    )
};

export default JirasChart;
